import React, { useState } from "react";
import {
  Container,
  Section,
  Span,
  StyledQuestionario,
  FormButton2,
  FormButton3,
  Modal,
  ModalContent2021,
  ModalBody,
  ModalHeader,
  ModalFooter,
} from "../../assets/style/StyledModal";

function MostraModal() {
  const [show, setShow] = useState(false);

  function enviarReceita() {
    alert("Receita enviada com sucesso!");
  }

  function sairModal() {
    setShow(!show);
  }

  return (
    <>
      {!show && (
        <Modal>
          <ModalContent2021>
            <ModalHeader>
              <Span>
                <h3>Modal</h3>
              </Span>
            </ModalHeader>

            <Container>
              <ModalBody>
                <Section>
                  <StyledQuestionario></StyledQuestionario>
                  <StyledQuestionario></StyledQuestionario>
                  <StyledQuestionario></StyledQuestionario>
                </Section>
              </ModalBody>

              <ModalFooter>
                <FormButton3 onClick={() => sairModal()}>Sair</FormButton3>
                <FormButton2 onClick={() => enviarReceita()}>
                  salvar
                </FormButton2>
              </ModalFooter>
            </Container>
          </ModalContent2021>
        </Modal>
      )}
    </>
  );
}
export default MostraModal;
